import React from 'react';
import Product from './Product';

const ProductList = (props) => {
    console.log('productList-props', props)
    return(
        <ul>
            {props.getAllProducts().map((elem, index) => {
            return (
                    <Product 
                        key={index}
                        name={elem.name}
                    />
                )
            })
        }
        </ul>
        
    )
}

export default ProductList;
